import { jsPDF } from "jspdf";

const font = '';

const registerRubikSemiBoldFont = () => {
    jsPDF.API.events.push(['addFonts', function () {
        this.addFileToVFS('Rubik-SemiBold-normal.ttf', font);
        this.addFont('Rubik-SemiBold-normal.ttf', 'Rubik-SemiBold', 'normal');
    }]);
};

export default registerRubikSemiBoldFont;
